export class NameForgeJS {
  /**
   * Generate random names based on specified settings.
   *
   * @param {Object} settings - The settings for generating names.
   * @param {string|string[]} [settings.starts_with='any'] - Starting letter or letters of the first name.
   * @param {string} [settings.name_type='human'] - Type of names to generate ('any', 'human', or 'animal').
   * @param {string|string[]} [settings.ends_with='any'] - Ending letter or letters of the first name.
   * @param {boolean} [settings.generate_last_name=true] - Whether to generate last names.
   * @param {string|string[]} [settings.country='any'] - Country for name generation ('denmark', 'usa', 'germany', or 'any').
   * @param {number} [settings.count=1] - Number of names to generate.
   * @param {number} [settings.names_with_title=0] - Percentage of names to include a title with.
   * @param {string} [settings.title='Mr.'] - Title to include with names.
   * @param {boolean} [settings.generate_age=false] - Whether to generate an age.
   * @param {number} [settings.min_age=0] - Minimum age to generate.
   * @param {number} [settings.max_age=100] - Maximum age to generate.
   * @returns {string[]} - An array of generated names.
   */
  generateNames(settings) {
    const defaultSettings = {
      name_type: 'human', // human
      starts_with: 'any', // first name starts with
      ends_with: 'any', // first name ends with
      generate_last_name: true, // should it generate a last name?
      gender: 'any', // male, female, or any
      country: 'any', // generate names from specific country
      count: 5, // how many names to generate
      names_with_title: 0, // percentage for names with a title
      title: 'Mr.', // specify a title
      generate_age: false, // should it generate an age?
      min_age: 0, // minimum age to generate
      max_age: 100, // maximum age to generate
    };

    const mergedSettings = { ...defaultSettings, ...settings };

    const {
      name_type,
      starts_with,
      ends_with,
      gender,
      count,
      names_with_title,
      title,
      country,
      generate_age,
      min_age,
      max_age,
    } = mergedSettings;

    const countryArray = Array.isArray(country) ? country : [country];
    const startsWithArray = Array.isArray(starts_with) ? starts_with : [starts_with];
    const endsWithArray = Array.isArray(ends_with) ? ends_with : [ends_with];

    function getRandomElement(array) {
      return array[Math.floor(Math.random() * array.length)];
    }

    function filterNames(namesArray, startsWith, endsWith) {
      return namesArray.filter((name) => {
        const firstName = name.split(' ')[0];

        const firstNameValid =
          (startsWith.includes('any') || startsWith.some((s) => firstName.toLowerCase().startsWith(s.toLowerCase()))) &&
          (endsWith.includes('any') || endsWith.some((e) => firstName.toLowerCase().endsWith(e.toLowerCase())));

        return firstNameValid;
      });
    }

    const generatedNames = [];
    for (let i = 0; i < count; i++) {
      let selectedCountry = countryArray.includes('any')
        ? getRandomElement(Object.keys(humanNames))
        : getRandomElement(countryArray);

      if (!humanNames[selectedCountry]) {
        console.error(`Error: Country code '${selectedCountry}' not found. Ensure the country code is in lowercase and uses underscores instead of spaces. For example, use 'united_states' instead of 'United States'.`);
    return [];
      }

      let firstName = '';
      let lastName = '';

      if (name_type === 'human') {
        if (gender === 'male') {
          const filteredMaleNames = filterNames(
            humanNames[selectedCountry].male,
            startsWithArray,
            endsWithArray
          );
          firstName = getRandomElement(filteredMaleNames);
        } else if (gender === 'female') {
          const filteredFemaleNames = filterNames(
            humanNames[selectedCountry].female,
            startsWithArray,
            endsWithArray
          );
          firstName = getRandomElement(filteredFemaleNames);
        } else {
          const allMaleNames = filterNames(
            humanNames[selectedCountry].male,
            startsWithArray,
            endsWithArray
          );
          const allFemaleNames = filterNames(
            humanNames[selectedCountry].female,
            startsWithArray,
            endsWithArray
          );
          const allNames = [...allMaleNames, ...allFemaleNames];
          firstName = getRandomElement(allNames);
        }

        if (mergedSettings.generate_last_name) {
          lastName = getRandomElement(humanNames[selectedCountry].last_names);
          lastName = lastName.charAt(0).toLowerCase() + lastName.slice(1);
        }
      } else if (name_type === 'animal') {
        firstName = getRandomElement(animalNames);
      } else {
        const isHuman = Math.random() < 0.5;
        if (isHuman) {
          if (gender === 'male') {
            const filteredMaleNames = filterNames(
              humanNames[selectedCountry].male,
              startsWithArray,
              endsWithArray
            );
            firstName = getRandomElement(filteredMaleNames);
          } else if (gender === 'female') {
            const filteredFemaleNames = filterNames(
              humanNames[selectedCountry].female,
              startsWithArray,
              endsWithArray
            );
            firstName = getRandomElement(filteredFemaleNames);
          } else {
            const allMaleNames = filterNames(
              humanNames[selectedCountry].male,
              startsWithArray,
              endsWithArray
            );
            const allFemaleNames = filterNames(
              humanNames[selectedCountry].female,
              startsWithArray,
              endsWithArray
            );
            const allNames = [...allMaleNames, ...allFemaleNames];
            firstName = getRandomElement(allNames);
          }

          if (mergedSettings.generate_last_name) {
            lastName = getRandomElement(humanNames[selectedCountry].last_names);
          }
        } else {
          firstName = getRandomElement(animalNames);
        }
      }

      let fullName = `${title} ${firstName} ${lastName}`.trim();
      let generatedName = fullName;

      const numNamesWithTitle = Math.round((names_with_title / 100) * count);

      if (i >= numNamesWithTitle) {
        generatedName = `${firstName} ${lastName}`;
      }

      // Modification starts here
      if (generate_age) {
        const age = Math.floor(Math.random() * (max_age - min_age + 1)) + min_age;
        generatedNames.push({
          name: generatedName,
          age: age
        });
      } else {
        generatedNames.push(generatedName);
      }
      // Modification ends here
    }

    return generatedNames;
  }

  /**
   * Prepares a JSON file for export and returns an object with a save method to download it.
   *
   * @param {string[]} names - The generated names to export.
   * @param {string} [filename='generated_names.json'] - The desired filename for the exported JSON file.
   * @returns {Object} - Object with a save method to trigger the download.
   */
  createJSONLink(names, filename = 'generated_names.json') {
    try {
      const jsonData = JSON.stringify(names, null, 2); // Pretty print JSON
      const blob = new Blob([jsonData], { type: 'application/json' });
      const url = URL.createObjectURL(blob);

      return {
        save: function () {
          // Create a link and trigger a download
          const downloadLink = document.createElement('a');
          downloadLink.href = url;
          downloadLink.download = filename;
          document.body.appendChild(downloadLink);
          downloadLink.click();

          // Cleanup
          document.body.removeChild(downloadLink);
          URL.revokeObjectURL(url);
        }
      };
    } catch (error) {
      console.error('Error preparing names for JSON export:', error);
      return {
        save: function () {
          console.error('No file prepared for download.');
        }
      };
    }
  }

  /**
   * Adds custom names to the existing names for a specified country.
   *
   * @param {string} country - The country for which to add custom names.
   * @param {Object} customNames - Custom names to add for the country.
   * @param {string[]} customNames.male - Custom male names to add.
   * @param {string[]} customNames.female - Custom female names to add.
   * @param {string[]} customNames.last_names - Custom last names to add.
   */
  setCustomNames(country, customNames) {
    if (!humanNames[country]) {
      humanNames[country] = { male: [], female: [], last_names: [] };
    }

    const { male, female, last_names } = customNames;
    if (male && Array.isArray(male)) humanNames[country].male.push(...male);
    if (female && Array.isArray(female)) humanNames[country].female.push(...female);
    if (last_names && Array.isArray(last_names)) humanNames[country].last_names.push(...last_names);
  }

  /**
   * Removes specified names from a country's name list.
   *
   * @param {string} country - The country from which to remove names.
   * @param {Object} namesToRemove - Names to remove for the country.
   * @param {string[]} namesToRemove.male - Male names to remove.
   * @param {string[]} namesToRemove.female - Female names to remove.
   * @param {string[]} namesToRemove.last_names - Last names to remove.
   */
  removeNames(country, namesToRemove) {
    if (!humanNames[country]) {
      console.warn(`No names found for the country: ${country}`);
      return;
    }

    const removeNamesFromArray = (sourceArray, namesArray) => {
      return sourceArray.filter(name => !namesArray.includes(name));
    };

    const { male, female, last_names } = namesToRemove;

    if (male && Array.isArray(male)) {
      humanNames[country].male = removeNamesFromArray(humanNames[country].male, male);
    }
    if (female && Array.isArray(female)) {
      humanNames[country].female = removeNamesFromArray(humanNames[country].female, female);
    }
    if (last_names && Array.isArray(last_names)) {
      humanNames[country].last_names = removeNamesFromArray(humanNames[country].last_names, last_names);
    }
  }
}
